import React from 'react';
import './App.css';
import AboutUs from './components/Footer/AboutUs';
import Footer from './components/Footer/Footer';
import Header from './components/Header/Header';
import { Chef } from './interfaces/chef';


function App() {

  const yossi: Chef = {
    age: 54,
    married: true,
    name: 'yossi',
    children: [
      {
        age: 14,
        name: 'matan',
        gender: 'male'
      }
    ]


  }

  return (
    <div className="App">
      <Header/>
      <AboutUs/>
      <Footer/>
    </div>
  );
}

export default App;
